(46, 'UXVhbCBhIHBhcnRl', 'Qual a parte', '{\n    \"time\": \"53.44163680076599 segundos\",\n    \"response\": [\n        [\n            7.473354569502199,\n            \"Psicologia   Como psic\\u00f3logo, eu me comprometo a colocar minha profiss\\u00e3o a servi\\u00e7o da sociedade  brasileira, pautando meu trabalho nos princ\\u00edpios da qual idade t\\u00e9cnica e do rigor \\u00e9tico.\"\n        ],\n        [\n            7.473354569502199,\n            \"Psicologia   Como psic\\u00f3logo, eu me comprometo a colocar minha profiss\\u00e3o a servi\\u00e7o da sociedade  brasileira, pautando meu trabalho nos princ\\u00edpios da qual idade t\\u00e9cnica e do rigor \\u00e9tico.Se eu cumprir este juramento com   fidelidade, gozem, para sempre, a minha vida e a minha arte, de boa reputa\\u00e7\\u00e3o entre   os   homens.\"\n        ],\n        [\n            7.473354569502199,\n            \"Psicologia   Como psic\\u00f3logo, eu me comprometo a colocar minha profiss\\u00e3o a servi\\u00e7o da sociedade  brasileira, pautando meu trabalho nos princ\\u00edpios da qual idade t\\u00e9cnica e do rigor \\u00e9tico.Se eu cumprir este juramento com   fidelidade, gozem, para sempre, a minha vida e a minha arte, de boa reputa\\u00e7\\u00e3o entre   os   homens.- me para manter a chama e o ideal por         Farm\\u00e1cia   Prometo que, ao exercer a profiss\\u00e3o de Farmac\\u00eautico, mostrar - me - ei sempre fiel aos   preceitos da honestidad e, da caridade e da ci\\u00eancia.\"\n        ],\n        [\n            4.922535617083209,\n            \"Na data designada para elei\\u00e7\\u00e3o dos membros da Comiss\\u00e3o de Formatura, dever\\u00e1   ser  lavrada:     a) uma lista de presen\\u00e7a contendo o nome, a matr\\u00edcula e a assinatura de   todos os  alunos participantes, na qual, ser\\u00e1 declarada pelos participantes a outorga de   poderes  aos eleitos para a realiza\\u00e7\\u00e3o de todos os atos necess\\u00e1rios \\u00e0 realiza\\u00e7\\u00e3o de todos   os  eve