(78857387068, 'ATIVIDADE 22/04/2020', 'Explique o que é um \"requisito de sistema\" e cite um exemplo.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDUxMzI1NDRa/sa/Nzg4NTczODcwNjha/details', '2020-04-23 02:33:40', '2020-04-23 22:30:55', '2020-4-23', '2:59', 5.00, 'SHORT_ANSWER_QUESTION', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91917904790, '2021-05-16 16:52:59', '2021-05-16 17:38:24', 74345132544),
(78874974115, 'Atividade 02 - Projeto Pedido', 'Desenvolver uma ou mais classes que tem como o objetivo manipular um módulo de pedidos, ou seja, é fundamental entender que: Um pedido possuí 1 cliente, 1 vendedor, 1 forma de pagamento, data de emissão e pode ter 1 ou mais produtos. Cada um dos atributos citados, podem ter seus próprios atributos e métodos. Desenvolver estas classes utilizando os pilares da POO já estudados até aqui.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDU5MTIxOTNa/a/Nzg4NzQ5NzQxMTVa/details', '2020-04-23 04:07:48', '2020-04-23 04:10:11', '2020-4-26', '2:59', 2.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91955060328, '2021-05-16 16:52:43', '2021-05-16 17:38:24', 74345912193),
