(82912061721, 'Atividade Herença/Polimorfismo', 'Um sistema de cadastro de clientes de uma empresa guarda informações sobre nomes, endereços e telefones. Além disso, caso o cliente seja uma pessoa física, seu número de CPF é armazenado e, caso o cliente seja uma pessoa jurídica, seu CNPJ e nome de fantasia da empresa devem ser guardados. A qualquer momento deve ser possível imprimir todos dados de um determinado cliente. Altere a modelagem a seguir e implemente as classes necessárias em C# utilizando os conceitos de polimorfismo e herança (não é necessário implementar o cadastro completo de clientes, apenas as definições se o cliente é física ou jurídica). ', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDU5MTIxOTNa/a/ODI5MTIwNjE3MjFa/details', '2020-05-07 03:51:33', '2020-05-07 04:05:50', '2020-5-9', '2:59', 1.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91955060328, '2021-05-16 16:52:43', '2021-05-16 17:38:24', 74345912193),
