(86990329158, 'Atividade Conta Corrente', 'Desenvolva em C# orientado a objetos um aplicativo bancário. Deve conter\nas classes de conta bancária, poupança, corrente, pessoa, cliente,\nbancário e gerente. Identifique os atributos e métodos essenciais para o\nfuncionamento do aplicativo. Deve-se aplicar o conceito de\npolimorfismo. Na classes principal devem ser instanciados objetos e\nrealizadas as operações convencionais de uma conta poupança, conta\ncorrente e atribuições dos funcionários na manipulação das contas dos\nclientes do banco. Exemplos: Gerente atribui limites de crédito ao cliente\ne funcionário realiza operações de empréstimos. Lembrando que as\noperações básicas das contas são impressões de saldos, extratos,\ncompensação de cheques, depósitos e transferências.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDU5MTIxOTNa/a/ODY5OTAzMjkxNTha/details', '2020-05-21 01:46:30', '2020-05-21 04:19:44', '2020-5-28', '2:59', 2.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91955060328, '2021-05-16 16:52:43', '2021-05-16 17:38:24', 74345912193),
(88813224625, 'ATIVIDADE VALENDO 7 PONTOS', 'RESPONDA TODAS AS QUESTÕES (NÃO PRECISA SER EM ORDEM) FAÇA A QUE DOMINA MAIS PRIMEIRO POR CAUSA DO TEMPO..PODE SER NUMA FOLHA SULFITE OU DO CADERNO \nRESPOSTAS DEVEM SER COM CANETA AZUL OU VERMELHA\nNÃO SERVE CANETA PRETA E NEM CÓPIA DE ARQUIVOS....PRECISO VER QUE VOCÊ RESOLVEU AGORA...\nTIRE FOTO DAS SUAS RESPOSTAS E POSTE AQUI...PREFERÊNCIA PDF OU JPEG\nRESPOSTAS ATÉ 22:50 (JÁ INCLUSO O TEMPO DE TIRAR FOTO E ENVIAR) \nENVIANDO DEPOIS DESSE HORÁRIO (O SISTEMA ACEITA) PORÉM O PRÓPRIO SISTEMA AVISA E VC TERÁ UM DESCONTO NA NOTA....\nSE QUISER PODE IMPRIMIR A PROVA E RESOLVER NELA MESMO..\nENVIEI DOIS ARQUIVOS DA MESMA PROVA....DOC OU PDF...VOCÊ ESCOLHE\nHOJE NÃO PODE TIRAR DÚVIDAS....A NÃO SER QUE ENCONTRE ERRO E NÃO DÊ PARA RESOLVER....', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDc1OTExNzla/a/ODg4MTMyMjQ2MjVa/details', '2020-05-30 02:44:17', '2020-05-30 04:46:10', '2020-5-30', '2:un', 7.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, NULL, '2021-05-16 16:52:57', '2021-05-16 17:38:24', 74347591179),
(88990717504, 'AVALIAÇÃO CÁLCULO NUMÉRICO - 26/06', 'Permitido uma única tentativa, sem possibilidade de reabertura ou mudança de prazos.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDc1OTExNzla/a/ODg5OTA3MTc1MDRa/details', '2020-06-01 04:29:25', '2020-06-28 05:33:02', '2020-6-27', '1:50', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, NULL, '2021-05-16 16:52:57', '2021-05-16 17:38:24', 74347591179),
(91955060310, 'EXERCÍCIO CLASSE FORNECEDOR', '\nDesenvolver uma classe que tenha como objetivo a modelagem de um fornecedor, ou seja, uma classe que seja possível instanciar fornecedores para manipulação deste objeto. Esta classe Fornecedor, deve conter ao menos 8 atributos e 4 métodos. Deverá ser utilizado as técnicas de abstração, encapsulamento e herança. Dado este problema, para resolver o problema da herança generalize uma classe com base no fornecedor. ', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDU5MTIxOTNa/a/OTE5NTUwNjAzMTBa/details', '2020-04-18 02:30:44', '2020-04-18 02:31:31', '2020-4-30', '2:59', 1.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91955060328, '2021-05-16 16:52:43', '2021-05-16 17:38:24', 74345912193),
