(93171872045, 'Atividade #5', 'Responda as questões sobre o gerenciamento da memória virtual.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/OTMxNzE4NzIwNDVa/details', '2020-04-23 22:41:08', '2020-04-24 03:24:38', '2020-4-28', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 89713276921, '2021-05-16 16:53:01', '2021-05-16 17:38:24', 74346721746),
(93171872162, 'Atividade #6 - Questões de Revisão ', 'Considerando os conceitos sobre o gerenciamento da memória virtual, responsa as questões a seguir. \n\nObs: A entrega da atividade será considerada como critério na atribuição da Nota de Aproveitamento.\n\nPERGUNTAS:\n\n1) Explique o conceito de Memória Virtual. Quais são as principais vantagens e desvantagens dessa técnica de gerenciamento de memória em relação à alocação puramente em memória principal?\n\n2) Explique qual é a finalidade do \"bit de validade\" existente na tabela de páginas dos processos? Qual é a relação do \"bit de validade\" com o evento de \"page fault\"?\n\n3) Conceitue \"thrashing\" e descreva quais são os principais fatores que podem contribuir para sua ocorrência? Explique o principal problema que ocorre em um sistema computacional quando a taxa de paginação for elevada?\n\n4) Considerando as políticas de busca de páginas estudadas, explique quais são as principais vantagens e desvantagens da \"paginação por demanda\" em relação à \"paginação antecipada\"? \n\n5) Considerando um determinado sistema computacional, explique qual é a relação entre a \"taxa de paginação\" e a \"quantidade de alocação de páginas na memória real\"?\n\n6) Considere um sistema onde um programa possa ser separado em duas partes: código e dados. A CPU sabe se ela precisa de uma instrução (busca de instrução) ou de dados (busca de dados). Portanto, dois pares de registradores, base e limite, são fornecidos: um para instruções e um para dados. O par de registradores base-limite para instruções é automaticamente posicionado para o estado de somente-leitura de modo que os programas possam ser compartilhados entre diferentes usuários. Discuta as vantagens e/ou desvantagens desse esquema. \n\n7) Assuma que um determinado sistema operacional (fictício) faz o gerenciamento da memória virtual considerando um espaço de endereçamento lógico de oito páginas, cada uma com 1024 palavras, mapeadas em uma memória física de 32 quadros (frames). No sistema operacional em questão, quantos bits tem o endereço lógico e quantos bits tem o endereço físico?\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/OTMxNzE4NzIxNjJa/details', '2020-04-23 22:46:21', '2020-04-27 21:51:10', '2020-5-4', '22:2', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 89713276921, '2021-05-16 16:53:01', '2021-05-16 17:38:24', 74346721746),
(93210408005, 'ATIVIDADE 23/04/2020', '\nDefina os requisito abaixo:\n1)Funcionais\n2) Não funcionais\n3) De domínio\n4) Do Usuário\n5) Do sistema\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDUxMzI1NDRa/sa/OTMyMTA0MDgwMDVa/details', '2020-04-24 02:33:27', '2020-04-24 02:34:44', '2020-4-24', 'unde', 5.00, 'SHORT_ANSWER_QUESTION', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 91917904790, '2021-05-16 16:52:59', '2021-05-16 17:38:24', 74345132544),
