(98212561449, 'Atividade #7 - Critérios de Substituição de Páginas na MV.', 'Analise a figura a seguir, que representa um sistema de gerenciamento de memória contendo 20 páginas virtuais, numeradas de 1 a 20. O referido sistema possui a memória principal com capacidade para armazenar até 6 quadros (frames). \n\nAssuma, em seguida, a sequência de referência de páginas virtuais de um programa, conforme ilustrado na figura e responda as questões:\n\n1) Qual é a quantidade de page faults gerada ao utilizar os critérios de substituição de frames: FIFO, LFU e LRU.  \n\n2) Qual critério de substituição de frames na memória principal foi mais eficiente? Por que?', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/OTgyMTI1NjE0NDla/details', '2020-04-27 21:51:56', '2020-04-27 22:07:05', '2020-5-8', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 99029757093, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
(105045366377, 'ATIVIDADE #9', 'Considerando as modalidades de processamento implementadas pelos sistemas operacionais, responda as questões a seguir:\n\n1) Descreva quais são as principais características do processamento batch. Dê alguns exemplos de aplicações originalmente processadas em batch.\n\n2) Descreva quais são as principais características dos sistemas de tempo compartilhado (time-sharing). \n\n3) Descreva quais são as principais diferenças entre os sistemas de tempo compartilhado e os sistemas de tempo real? Cite alguns exemplos de aplicações em que a utilização de sistemas de tempo-real é recomendada.\n\n4) Qual é a principal dificuldade que um programador precisa contornar na escrita de um sistemas operacional para um ambiente de tempo real?\n\n5) Explique os critérios de escalonamento de tempo real “Rate Monotonic” e “Earliest Deadline First”. \n\n6) Como os sistemas de tempo real são classificados”?\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA1MDQ1MzY2Mzc3/details', '2020-05-22 00:47:13', '2020-05-24 20:10:46', '2020-5-28', '23:u', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 105015072238, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
(105579261737, 'ATIVIDADE #3', 'DATA:  09/03/2020\n(ATIVIDADE ENTREGUE DURANTE A AULA PRESENCIAL)\n\nCONSIDERANDO OS CONCEITOS RELACIONADOS AO GERENCIAMENTO DE MEMÓRIA IMPLEMENTADO PELOS SISTEMAS OPERACIONAIS RESPONDA AS QUESTÕES A SEGUIR:\n\n1) Explique por que na paginação não ocorre a fragmentação externa da memória principal, porém pode ocorrer a fragmentação interna?\n\n2) O Princípio da Localidade pode ser aplicado à paginação? Justifique sua resposta.\n\n3) Explique o processo de mapeamento de endereços lógicos em endereços físicos na paginação. Pesquise o que é Translation Lookaside Buffer e qual é sua finalidade no processo de mapeamento de endereços?\n\n\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA1NTc5MjYxNzM3/details', '2020-05-24 19:07:01', '2020-05-24 19:15:47', '2020-3-10', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 105577160575, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
(105580126967, 'ATIVIDADE #4', 'DATA:  12/03/2020\n\n(ATIVIDADE ENTREGUE DURANTE A AULA PRESENCIAL)\n\nCOM BASE NOS CONCEITOS SOBRE GERENCIAMENTO DE MEMÓRIA ESTUDADOS, RESPONDA AS QUESTÕES A SEGUIR:\n\n1) Explique como o Swapping se propõe a resolver o problema de falta de memória para executar os processos?\n\n2) A técnica Swapping pode ser executada sem a relocação do código na memória? Justifique sua resposta.\n\n3) Qual é a principal vantagem e desvantagem da técnica swapping no gerenciamento da memória?\n\n4) Explique como o swapping pode ser executado em conjunto com a paginação?\n  ', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA1NTgwMTI2OTY3/details', '2020-05-24 18:41:16', '2020-05-24 19:24:35', '2020-3-13', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 105577160575, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
(105583171811, 'ATIVIDADE #2', 'DATA:  02/03/2020\n\n(ATIVIDADE ENTREGUE DURANTE A AULA PRESENCIAL)\n\nCOM BASE NOS CONCEITOS ESTUDADOS SOBRE GERENCIAMENTO DE MEMÓRIA RESPONDA AS QUESTÕES A SEGUIR:\n\n1) Compare a técnica de particionamento com a alocação contígua simples e explique suas principais diferenças, vantagens e/ou desvantagens? Como é realizada a proteção de memória no particionamento?\n\n2) O que significa Código Absoluto e Código Relocável? Qual é a principal vantagem e desvantagem de cada um desses métodos? Explique o processo Base-Mais-Deslocamento.\n\n3) Considerando a técnica do particionamento, explique o significado e em que situação ocorre a fragmentação interna e a fragmentação externa. \n\n\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA1NTgzMTcxODEx/details', '2020-05-24 19:25:59', '2020-05-24 19:28:33', '2020-3-3', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 105577160575, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
(105583927251, 'ATIVIDADE #1', 'DATA:  17/02/2020\n\n(ATIVIDADE ENTREGUE EM SALA DE AULA - PRESENCIAL)\n\nCONSIDERANDO OS CONCEITOS BÁSICOS DE SISTEMAS OPERACIONAIS ESTUDADOS, RESPONDA AS QUESTÕES A SEGUIR:\n\n1) Explique o que significa \"kernel\" de um sistema operacional? Quais são as principais tarefas executadas por um \"kernel\"?\n\n2) O que significa execução em \"modo usuário\", execução em \"modo kernel\" e \"chamada de sistema\".\n\n3) Conceitue \"compartilhamento de recursos\". Explique quais são os principais recursos compartilhados em uma arquitetura computacional?\n\n4) Considerando a hierarquia dos dispositivos de armazenamento estudados, explique porque os sistemas computacionais devem realizar a migração dos dados entre esses dispositivos?\n\n   ', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA1NTgzOTI3MjUx/details', '2020-05-24 19:51:26', '2020-05-24 19:58:33', '2020-2-18', '2:59', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 105577160575, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
