(107817077059, 'ATIVIDADE #10', 'Considere os conceitos de gerenciamento de processos estudados e responsa as questões a seguir:\n\n1) Descreva os principais conteúdos existentes nos contextos e hardware e software de um processo?\n\n2) Qual é a finalidade dos parâmetros “owner” e “privilégios” existentes na PCB dos processos?\n\n3) Explique quais são os principais estados que um processo pode assumir. Descreva o que ocorre com um processo quando ele se encontra em um determinado estado. Em seguida, descreva quais eventos podem levar um processo de um estado a outro no sistema?\n\n4) Descreva um exemplo de aplicação CPU-Bound, justificando por que você considerou essa aplicação como sendo CPU-Bound. \n\n5) Descreva um exemplo de aplicação IO-Bound, justificando por que você considerou essa aplicação como sendo I/O-Bound. \n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTA3ODE3MDc3MDU5/details', '2020-06-01 16:50:17', '2020-06-02 01:16:36', '2020-6-8', '22:u', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 107817077052, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
