(114598460766, 'AVALIAÇÃO DE SISTEMAS OPERACIONAIS 2 - @N1- 22/06/2020', 'A prova é individual e vale de ZERO a DEZ pontos sendo composta de:\n   - 03 questões objetivas valendo 1,0 ponto cada;    \n   - 07 questões dissertativas valendo 1,0 ponto cada;     \n\nO tempo limite para realização da prova é de 90 minutos.\nO entendimento das questões faz parte da avaliação.\nSerá permitido uma única tentativa, e não há possibilidade de extensão de prazos ou reabertura.\nPara as provas entregues fora do prazo será atribuída a nota ZERO.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTE0NTk4NDYwNzY2/details', '2020-06-22 15:20:27', '2020-06-23 01:30:14', '2020-6-23', 'unde', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 114706717550, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
