(115404152646, '(N3) AVALIAÇÃO DE SISTEMAS OPERACIONAIS 2 – 02/07/2020', 'A prova é individual e vale de ZERO a DEZ pontos sendo composta de:\n   - 03 questões objetivas valendo 1,0 ponto cada;    \n   - 07 questões dissertativas valendo 1,0 ponto cada;     \n\nO tempo limite para realização da prova é de 90 minutos.\nO entendimento das questões faz parte da avaliação.\nSerá permitido uma única tentativa e não há possibilidade de extensão de prazos ou reabertura da prova.\nPara as provas entregues fora do prazo será atribuída a nota ZERO.\n', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTE1NDA0MTUyNjQ2/details', '2020-06-27 20:54:02', '2020-07-03 03:24:08', '2020-7-3', '1:50', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 115404152596, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
