(125442169581, 'Atividade #8', 'Considerando os conceitos de sistemas multiprocessados estudados, responda as questões a seguir.\n\n1) Um dos principais objetivos do sistema operacional durante o compartilhamento do processador é maximizar o throughput do sistema. Explique o significado de throughtput no contexto apresentado.\n\n2) Explique o que são sistemas multiprocessados fortemente acoplados e quais são as principais vantagens proporcionadas por esses sistemas, em relação aos sistemas monoprocessados? Dê um exemplo de aplicação em que a utilização desses sistemas é recomendada.\n\n3) Descreva quais são as principais diferenças entre o multiprocessamento simétrico e assimétrico. Cite três vantagens dos sistemas multiprocessados fortemente acoplados simétricos em relação aos sistemas assimétricos.\n\n4) Identifique e comente as principais diferenças entre os sistemas multiprocessados fortemente acoplados e os sistemas fracamente acoplados. \n\n5) Explique as principais diferenças entre os sistemas fracamente acoplados (SOR) e (SOD)?\n\n6) Conceitue Computação em Grade. Pesquise um projeto na Internet que utiliza o modelo de computação em grade e descreva esse projeto, informando sua finalidade, suas principais características, órgãos que participam de sua execução, principais resultados já obtidos, etc.', 'PUBLISHED', 'https://classroom.google.com/c/NzQzNDY3MjE3NDZa/a/MTI1NDQyMTY5NTgx/details', '2020-05-14 22:18:12', '2020-05-24 20:10:33', '2020-5-21', '22:2', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 102422411152, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 74346721746),
