(149768842718, 'Atividade - Gráfico', 'RESOLVER PREFERENCIALMENTE DE FORMA DIGITAL – WORD, EXCEL. GEOGEBRA\nSE FEITO MANUALMENTE, FOTOGRAFAR E INSERIR TODAS AS IMAGENS EM UM ÚNICO ARQUIVO\nENVIAR AS RESOLUÇÕES DOS EXERCÍCIOS NA ORDEM DOS ENUNCIADOS\nENVIEM APENAS UM ARQUIVO COM TODAS AS RESOLUÇÕES.\n', 'PUBLISHED', 'https://classroom.google.com/c/MTQ3NjI3NDE1NDMy/a/MTQ5NzY4ODQyNzE4/details', '2020-10-06 00:23:05', '2020-11-28 16:44:35', '2020-10-6', '1:50', 2.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 163918042024, '2021-05-16 16:52:57', '2021-05-16 17:38:24', 147627415432),
(152376785167, 'Atividade QS01 - PDCA, Ishikawa e Custo da Qualidade', 'A XPTO Systems é uma consultoria de TI que desenvolve portais Web e sistemas de informações para pequenas e médias empresas de diversos setores como indústrias, comércios, restaurantes e escritórios de contabilidade.\nEm um recente projeto entregue pela XPTO a um cliente que atua com restaurantes, foi necessário desenvolver uma nova funcionalidade no portal Web para os consumidores que solicitavam pedidos de delivery e também de retirada de refeições. Um dos problemas apontados pelo cliente logo após a implantação desta funcionalidade foi a demora para o consumidor receber a confirmação do pedido feito junto ao restaurante, inclusive algumas ocorrências em que o consumidor não chegou a receber a confirmação, mas o pedido foi confirmado e entregue, ou outras em que o pedido sequer foi confirmado.\n\nDiante do contexto acima, pede-se:\n1) Quais os conjuntos de causas prováveis a respeito deste problema? \n2) Com base no PDCA descreva que ações relacionadas ao P-Plan e ao D-Do que você aplicaria para implantar a melhoria necessária no portal do cliente?\n3) Que tipos de itens de custo estão envolvidos na melhoria da qualidade para o problema identificado?\n\nObservações: \n* Entrega individual ou em duplas;\n* Caso seja em duplas, os 2 estudantes devem entregar cada um a sua cópia;\n* Anexar as respostas em arquivo DOC, DOCX ou PDF.', 'PUBLISHED', 'https://classroom.google.com/c/MTQ3NjI3NjM2OTI0/a/MTUyMzc2Nzg1MTY3/details', '2020-08-28 21:48:34', '2020-08-29 03:11:51', '2020-9-12', 'unde', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 152376784885, '2021-05-16 16:52:58', '2021-05-16 17:38:24', 147627636924),
