(188174462115, 'N1 Metodologia da Pesquisa', 'Turmas: 109 - 06AN - outubro 2020\nProfª Drª Helena Degreas\n\nÉ permitida a seleção de uma alternativa. Por favor, envie a prova durante o horário da aula. O envio posterior não será aceito pela plataforma.\nEsta avaliação contem 3 questões de múltipla escolha valendo 2 pontos cada uma e 1 questão dissertativa valendo 4 pontos. A soma de todos os pontos da prova é dez.\nVocê está autorizado a utilizar o seu projeto de pesquisa para a realização da prova.', 'PUBLISHED', 'https://classroom.google.com/c/MTQ3NjA5MDYwMDc4/a/MTg4MTc0NDYyMTE1/details', '2020-10-15 23:36:31', '2020-10-21 01:22:29', '2020-10-2', 'unde', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, NULL, '2021-05-16 16:52:58', '2021-05-16 17:38:24', 147609060078),
(197576397494, 'AVALIAÇÃO #N1 – 19/10/2020', 'A prova é individual e vale de ZERO a DEZ pontos sendo composta de:\n- 3 questões objetivas valendo 1,0 ponto cada; \n- 7 questões dissertativas valendo 1,0 ponto cada; \n\nO tempo limite para realização da prova é de 90 minutos. \nO entendimento das questões faz parte da avaliação. \nSerá permitido uma única tentativa e não há possibilidade de extensão de prazos ou reabertura. \nPara as provas entregues fora do prazo será atribuída a nota ZERO.\n', 'PUBLISHED', 'https://classroom.google.com/c/MTQ3NjI1NjYzODg0/a/MTk3NTc2Mzk3NDk0/details', '2020-10-17 23:58:21', '2020-10-20 01:21:08', '2020-10-2', 'unde', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 188486615708, '2021-05-16 16:53:00', '2021-05-16 17:38:24', 147625663884),
(198010969877, 'N1', '- RESOLVAM NA ORDEM EM QUE AS QUESTÕES ESTÃO ELENCADAS\n- SEJA MANUSCRITO OU DIGITAL, ENVIEM UM ÚNICO ARQUIVO (se mais de um for enviado, somente um será considerado)\n- NAS SOLUÇÕES GRÁFICAS: é imprescindível a identificação das variáveis nos eixos. Se isso não for feito, será atribuída nota zero.\n- Caso usem o Geogebra para os gráficos, copiem o gráfico (em escala adequada) no documento da solução.\n- TEMPO MÁXIMO DE REALIZAÇÃO: 90 MINUTOS.\n\n', 'PUBLISHED', 'https://classroom.google.com/c/MTQ3NjI3NDE1NDMy/a/MTk4MDEwOTY5ODc3/details', '2020-10-19 16:11:32', '2020-10-20 03:10:30', '2020-10-2', '1:40', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 186724524198, '2021-05-16 16:52:57', '2021-05-16 17:38:24', 147627415432),
