(295574314504, 'Prototipação para análise de funcionalidades', 'Elabore um protótipo – (precisa ser navegável)\n-> Entregue um arquivo ZIP ou RAR com a pasta contendo os arquivos HTML/CSS/Javascript\nConsidere uma tela com uma lista de empresas clientes;(30%)\nA tela seguinte é a ficha da empresa; (50%)\nA tela final é da pessoa de contato da empresa selecionada; (70%)\n- O esboço das telas pode ser em powerpoint ou pdf; (80%)\nO Ideal é protótipo navegável com HTML e CSS; (90%)\nÉ desejável uso de Javascript; (100%)\nVeja dicas de Javascript:', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDYzOTMzOTI4/a/Mjk1NTc0MzE0NTA0/details', '2021-03-11 02:37:02', '2021-03-18 03:27:31', '2021-4-15', '2:59', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, NULL, '2021-05-16 16:52:51', '2021-05-16 17:38:24', 252463933928),
