(308981752323, 'N1 - TEC-I - 1o Sem. 2021 - Alunos de Luiz Felipe à Vitor Figueiredo', 'Olá, Caro(a) Aluno(a),\n\nA nossa avaliação N1 contabilizará até 10,0 (dez) pontos e é constituída de 3 (três) questões de múltipla escolha no valor de 3,0 (três) pontos e 4 questões dissertativas no valor de 7,0 (sete) pontos.\n\nA N1 estará disponível para ser realizada no dia 14 de abril a partir das 20h e deve ter sido finalizada até as 23h. \n\nAo iniciar, você terá 2 horas para concluir a avaliação. \n\nFicar atento ao período e ao tempo estabelecido de sua realização, pois vou verificar se o prazo e o tempo estipulados foram cumpridos para cada aluno, ok!\n\nPara iniciá-la, basta acessar a nossa disciplina no “Google sala de aula\", selecionar a atividade N1 dentro do tópico \"Avaliação\", ler as instruções e pressionar no formulário correspondente ao título \"TEC I - N1 – 1o Sem. 2021\" e ao seu nome.\n\nNo período de realização da N1, eu ficarei monitorando meu e-mail (ivan.oliveira@online.uscs.edu.br). \n\nEntão, caso haja algum problema durante a sua realização, por exemplo, queda da Internet ou computador desligou ou algum outro problema, o(a) aluno(a) deve me encaminhar um e-mail para que eu avalie o ocorrido contendo no assunto \"N1 - Nome Completo - Nome do Curso - Nome da Disciplina\". \n\nSe realmente for confirmado o problema, vou eliminar a tentativa para nova realização e o(a) aluno(a) será comunicado(a) também por e-mail, ok!\n\nAs notas finais da N1 devem ficar disponíveis a partir da segunda-feira (26 de abril).\n\nBoa avaliação! \nUm abraço,\nprof. Ivan.\n', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDY1NjA1NTE2/a/MzA4OTgxNzUyMzIz/details', '2021-03-29 16:34:03', '2021-04-15 02:00:18', '2021-4-15', '2:un', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 308981752290, '2021-05-16 16:52:46', '2021-05-16 17:38:24', 252465605516),
(309970293877, 'N1 – COMP - CCP - 2021', 'Olá, Caro(a) Aluno(a),\n\nA nossa avaliação N1 contabilizará até 10,0 (dez) pontos e é constituída de 4 (três) questões de múltipla escolha no valor de 4,0 (quatro) pontos e 4 questões dissertativas no valor de 6,0 (seis) pontos.\n\nA N1 estará disponível para ser realizada no dia 19 de abril a partir das 18h30min e deve ter sido finalizada até as 22h. \n\nAo iniciar, você terá 2 horas para concluir a avaliação. \n\nFicar atento ao período e ao tempo estabelecido de sua realização, pois vou verificar se o prazo e o tempo estipulados foram cumpridos para cada aluno, ok!\n\nPara iniciá-la, basta acessar a nossa disciplina no “Google sala de aula\", selecionar a atividade N1 dentro do tópico \"Avaliação\", ler as instruções e pressionar no formulário correspondente ao título \"N1 – COMP - CCP - 2021\".\n\nNo período de realização da N1, eu ficarei monitorando meu e-mail (ivan.oliveira@online.uscs.edu.br). Então, caso haja algum problema durante a sua realização, por exemplo, queda da Internet ou computador desligou ou algum outro problema, o(a) aluno(a) deve me encaminhar um e-mail para que eu avalie o ocorrido contendo no assunto \"N1\n- Nome Completo - Nome do Curso - Nome da Disciplina\". \n\nSe realmente for confirmado o problema, vou eliminar a tentativa para nova realização e o(a) aluno(a) será comunicado(a) também por e-mail, ok!\n\nAs notas finais da N1 devem ficar disponíveis a partir da segunda-feira (26 de abril).\n\nBoa avaliação!\nUm abraço,\nprof. Ivan.', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDY1Mzk3MTc5/a/MzA5OTcwMjkzODc3/details', '2021-04-04 00:35:10', '2021-04-20 00:32:43', '2021-4-20', '1:un', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 309970293874, '2021-05-16 16:52:54', '2021-05-16 17:38:24', 252465397179),
(316483111897, 'N1 - Álgebra Linear Computacional', 'A prova vale de ZERO a DEZ pontos\nsendo composta de:\n\n       - 02 questões objetivas valendo 1,0 ponto cada;\n\n       - 04 questões discursivas valendo 2,0 pontos cada;\n\n\n\nler o enunciado com atenção\nrealizar os cálculos à mão, inserindo seu nome e assinatura;\nfotografar a resolução dos exercícios;\ninserir a foto devidas questões no próprio formulário, que se encontram no documento do download; \nEnviar o formulário com as fotos inseridas e as respostas das questões objetivas marcadas;\nO tempo limite para realização\nda prova é de 90 minutos;\n\n\nØ  Não faça perguntas ao professor sobre a prova. O entendimento das questões faz\nparte da avaliação;\n\nØ  O estudante que chegar atrasado, em até 30 minutos do início da\nprova, poderá fazê-la, desde que nenhum de seus colegas tenha deixado a sala. O\nhorário limite para entrega da prova não será\ndilatado;\n\nØ  Descumprir\nqualquer instrução acima pode implicar desconto na nota ou atribuição de nota\nzero.\n', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDcyNzA2NjEw/a/MzE2NDgzMTExODk3/details', '2021-04-15 21:13:29', '2021-04-17 03:00:45', '2021-4-17', '1:50', 10.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 323629418125, '2021-05-16 16:52:59', '2021-05-16 17:38:23', 252472706610),
(321330084667, 'Atividade Avaliativa - Lisp', 'Prezados alunos, \n\n\nEssa atividade pode ser executada em dupla ou trio. Apenas um integrante do grupo deve submeter a resolução.\n\n\nAo submeter a atividade o líder do grupo deve informar o número de matricula e o nome completo de cada integrante.\n\n\nBoa sorte a todos!', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDY1Mjg2NzU3/a/MzIxMzMwMDg0NjY3/details', '2021-04-07 00:14:43', '2021-04-07 02:46:50', '2021-4-12', '2:59', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 270599812205, '2021-05-16 16:52:59', '2021-05-16 17:38:24', 252465286757),
(321878669956, 'Atividade A1 - Avaliação Processual ', NULL, 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDY4NzA0MTIw/a/MzIxODc4NjY5OTU2/details', '2021-04-08 22:38:14', '2021-04-09 01:10:18', '2021-4-9', 'unde', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 321873789387, '2021-05-16 16:52:58', '2021-05-16 17:38:23', 252468704120),
(323288820997, 'N1 - Análise de Desempenho de Sistemas', 'Você tem 90 minutos para responder às questões dessa avaliação, após esse tempo o sistema será bloqueado.\n\n\nLeia os enunciados com atenção, responda corretamente cada questão conforme solicitado.\n\n\nSe tiver algum problema informe pelo Chat.\n\n\nFIQUE ATENTO AO HORÁRIO DE TÉRMINO DA PROVA\n\n\nTenha certeza do envio da prova. \n\n\nAO FINAL DA PROVA: após o envio da prova, coloque no CHAT: \n\n\nMatrícula: ______-_   -  Presente - Prova enviada.\n\n\nIMPORTANTE: \nCaso tente editar a prova para verificar respostas, o sistema faz log desse procedimento, sua nota será zerada posteriormente e você poderá sofrer uma consequência administrativa junto à instituição.', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDYzOTMzOTI4/a/MzIzMjg4ODIwOTk3/details', '2021-04-14 21:44:19', '2021-04-15 01:21:39', '2021-4-15', 'unde', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, NULL, '2021-05-16 16:52:51', '2021-05-16 17:38:24', 252463933928),
