(323367237393, 'Avaliação N1 ', 'Boa noite, \n\nDesde já desejo muita sorte na execução desta avaliação. Aqui estão algumas orientações básicas.\n\n- Leia as questões com atenção;\n- Respostas iguais anulam as provas de todos os envolvidos;\n\nSucesso!!!', 'PUBLISHED', 'https://classroom.google.com/c/MjUyNDY1Mjg2NzU3/a/MzIzMzY3MjM3Mzkz/details', '2021-04-15 03:19:16', '2021-04-21 01:25:26', '2021-4-21', '1:un', 100.00, 'ASSIGNMENT', 'MODIFIABLE_UNTIL_TURNED_IN', 9223372036854775807, 323367237391, '2021-05-16 16:52:59', '2021-05-16 17:38:24', 252465286757),
