(313598025052, 'Exemplos de perguntas para a primeira fase', 'https://classroom.google.com/c/MjUyNDYzOTMzOTI4/m/MzEzNTk4MDI1MDUy/details', 'Qual dos aspectos a seguir NÃO é um dos aspectos envolvidos na análise de desempenho computacional?\n\n\n\n\nUm programa escrito em linguagem de alto nível, que representa uma classe de aplicações, usado para medir o desempenho de uma arquitetura de sistema em várias máquinas, no conceito de Benchmark é uma técnica de:\n\n\n\n\nDas descrições a seguir, qual NÃO é um uso do benchmark na computação;\n\n\n\n\nAlém de identificar pontos fortes e fracos de um sistema em particular ou de aplicações Arquitetura do Sistema; Sobrecarga do Sistema Operacional; Sobrecarga de Comunicação, qual outro aspecto o Benchmark avalia?\n\n\n\n\nSegundo o Comitê Parkbench (Parallel Kernels and Benchmarks), podemos classificar os bechmarks de computação em duas vertentes de arquitetura, respectivamente:\n\n\n\n\nA medição histórica de desempenho de hardware com comparações técnicas é encontrada no primeiro grande programa escrito para Benchmark, elaborado para análise da capacidade de cálculos numéricos intensivos de números de ponto flutuante, sua medida de comparação é dada em \"Vector Loops\" - número de loops por segundo. Essas características descrevem qual Benchmark de mercado?\n\n\n\n\nA metodologia de Benchmark Whetstone, primeiro grande programa escrito para Benchmark, seu algoritmo foi elaborado para análise da capacidade de cálculos numéricos intensivos de números de ponto flutuante. A medida de comparação é dada em número de:\n\n\n\n\nEntre as características técnicas da metodologia de Benchmark Whetstone, notamos que possui alto percentual de dados e operações de ponto flutuante, usa variáveis globais na programação, não usa variáveis locais nas funções de sua programação, durante sua execução apresenta alto percentual de uso de:\n\n\n\n\nEntre as características técnicas da metodologia de Benchmark Whetstone, notamos que possui alto percentual de dados e operações de ponto flutuante, com alto percentual de tempo de CPU (execução), que é gasto em funções matemáticas. Nas funções de sua programação, notam-se que usam variáveis:\n\n\n\n\nO Benchmark SPEC, System Performance Evaluation Cooperative, além dos aspectos: CPU; Aplicações de Alto Desempenho: MPI e OpenMP; Cliente/Servidor Java: Projetado para medir o desempenho de servidores rodando aplicações Java; Mail Servers: Mede desempenho de servidores de e-mail; Network Files Systems; WEB Servers: Simula usuários enviando requisições; considera qual outro aspecto na sua solução de avaliação de desempenho?\n\n\n\n\nNo uso de Benchmarks para Arquiteturas Paralelas e Sistemas Distribuídos, notamos que cada tipo de arquitetura tem um Benchmark específico. Um exemplo é o PING e o PING-PONG, que são usados na avaliação de:\n\n\n\n\nNo uso de Benchmarks para Arquiteturas Paralelas e Sistemas Distribuídos, notamos que cada tipo de arquitetura tem um Benchmark específico. Um exemplo é o TTCP, que é usados na avaliação de comunicação usando TCP ou:\n\n\n\n\nO Benchmark Webstone, desenvolvido pela Silicon Graphics – mantido pelo Mindcraft test lab, que tem como objetivo medir o desempenho de software e hardware de servidores Web, testa vários aspectos no servidor. Mas há um aspecto que ele NÃO testa, que é:\n\n\n\n\nA quantidade de dados/bits transmitidos em uma arquitetura de comunicação: Barramento / Rede / Disco - é medida em Kbits por segundo ou Mbps, ou Gbps, ou Tbps. O termo técnico para esse fluxo é:\n\n\n\n\nEntre os sistemas de benchmark de mercado, o Surge permite que o usuário possa especificar um conjunto de threads que será analisado, sua arquitetura é composta por um conjunto de clientes virtuais, criados por software, conectados a um servidor Web e permite avaliar requisições a documentos no servidor. O Surge apresenta dois estados que são ON e OFF, que significam:\n\n\n\n\nEntre os sistemas de benchmark de mercado, o Surge permite que o usuário possa especificar um conjunto de threads que será analisado, sua arquitetura é composta por um conjunto de clientes virtuais, criados por software, conectados a um servidor Web e permite avaliar requisições a documentos no servidor. O Surge também é capaz de testar o desempenho de:\n\n\n\n\nEntre os sistemas de benchmark de mercado, um deles é uma ferramenta para medir desempenho web que gera várias cargas HTTP, tem maior dependência do Sistema Operacional, usa uma única Thread de teste, e tem um mecanismo próprio de Timeout. Estamos nos referindo ao:\n\n\n\n\nA implementação paralela do LINPACK benchmark chamada HPL (High Performance Linpack) é usada para comparar e classificar supercomputadores para a lista TOP500, e usa a biblioteca BLAS (Basic Linear Algebra Subprograms) para executar operações básicas com:\n\n\n\n\nNo fluxo de produção de um protótipo, avaliamos 10 etapas, entre elas, por ordem sequencial: Levantamento de funcionalidades do Sistema;Priorizar funcionalidades;Definir um MVP – Minimum Valued Product (Métodologia ágil);Detalhamento de regras comportamentais de cada funcionalidade;Desenvolver o Protótipo; Qual a próxima etapa dessa sequência?\n\n\n\n\n\n\nUma rede de Petri é uma representação matemática para sistemas distribuídos discretos.  Como uma linguagem de modelagem, ela define graficamente a estrutura de um sistema distribuído como um grafo direcionado com comentários. Possui nós de posição, nós de transição, e arcos direcionados conectando posições com transições. Transições agem em tokens de entrada por um processo denominado disparo. Quando uma transição é disparada, ela consome os tokens de suas posições de entrada, realiza alguma tarefa de processamento, e realoca um número específico de tokens nas suas posições de saída.Redes de Petri são muito utilizadas para modelar comportamento concorrente em sistemas distribuídos, pois:\n\n\n\n\nEm um sistema computacional, o desempenho é um grande diferencial, considerando que o principal objetivo de todo o tipo de automação seja o ganho de velocidade e escalabilidade. Nesse contexto, definimos que o desempenho do computador é medido:\n\n\n\n\nO desempenho computacional é um conceito que passa pelo desempenho de hardware e de software, envolve vários aspectos técnicos e funcionais. Qual dos aspectos descritos a seguir NÃO é referente ao desempenho computacional?\n\n\n\n\nEntre as técnicas de avaliação de desempenho computacional, destacamos a aferição, que recomenda diversas etapas durante o planejamento do experimento. Entre as tarefas, antes de determinar o nível de detalhamento da análise, e depois de selecionar métricas de avaliação, qual etapa é recomendada?\n\n\n\n\nNo cenário de avaliação de desempenho, a replicação do sistema em um modelo, que obedece às mesmas entradas, permite avaliar o desempenho do mesmo sistema em outro ambiente operacional, com características de configuração diferente. O exercício dessa replicação recebe o nome técnico de:\n\n\n\n\nDiante das técnicas de avaliação de desempenho, conhecemos a modelagem que comporta diversas características. Entre as características descritas a seguir, qual NÃO é uma característica da modelagem?\n\n\n\n\nConforme descrito em exemplo, o lançamento de dados resulta num processo estocástico, pois qualquer uma das 6 faces do dado tem iguais probabilidades de ficar para cima após o arremesso. Em teoria probabilística, o padrão estocástico é aquele em que:\n\n\n\n\nNa análise matemática, uma equação diferencial ordinária envolve as derivadas de uma função desconhecida de uma determinada variável. Um exemplo simples de uma equação diferencial ordinária é: f’=f, onde f é uma função desconhecida e f’ sua derivada. Refletindo esse conceito na análise computacional, entende-se que nas soluções de equações diferenciais ordinárias:\n\n\n\n\nDe acordo com as características da técnica de avaliação de desempenho da modelagem, entende-se que são desvantagens da modelagem:\n\n\n\n\nA técnica de avaliação de desempenho da aferição possui características que definem sua aplicação, bem como cuidados em sua utilização. Qual das definições a seguir NÃO se refere à técnica da aferição?\n\n\n\n\nDe acordo com as características da técnica de avaliação de desempenho da aferição, entende-se que é uma vantagem da aferição:\n\n\n\n\nUma medição de desempenho por aferição, que se caracteriza por ser um instrumento fixo, que permite comparar uma medida a um padrão pré-estabelecido, já descoberto anteriormente, bem como necessitada de um ponto de observação, é conhecida como:\n\n\n\n\nAlém de poder ser composto por um programa escrito em linguagem de alto nível, que representa uma classe de aplicações, usado para medir o desempenho de uma arquitetura de sistema em várias máquinas, \"Benchmark\" também pode ser ser usado para definir:\n\n\n\n\nNa aferição de desempenho computacional, a qual das situações a seguir não se aplica o benchmark?\n\n\n\n\nMuitas são as medidas de desempenho utilizadas na computação, são muito relevantes para análise comparativa de computadores de mesma arquitetura que apresentam características similares de hardware e software. Consideramos que cada medida se aplica melhor a um aspecto de processamento a ser avaliado. Entendendo que o software ALPHA é prioritariamente processamento de texto, e o software BEHTA é usado para cálculos de engenharia, quais unidades de medida deverão ser usadas para leitura dos resultados dos testes de forma mais adequada?\n\n\n\n\nQual aspecto não é necessário conhecer para interpretar os resultados relacionados ao Benchmark?\n\n\n\n\nNo uso do Benchmark, classificamos dois tipos de arquiteturas a serem analisadas, que nomeamos respectivamente programação sequencial e programação paralela. Entre os aspectos analisados, o que melhor identifica a análise do benchmark aplicado à programação sequencial é:\n\n\n\n\nNo uso do Benchmark, classificamos dois tipos de arquiteturas a serem analisadas, que nomeamos respectivamente programação sequencial e programação paralela. Entre os aspectos analisados, o que melhor identifica a análise do benchmark aplicado à programação paralela é:\n\n\n\n\nO primeiro grande programa escrito para Benchmark, elaborado para análise da capacidade de cálculos numéricos intensivos de números de ponto flutuante, tem apenas a versão em Pascal controlada pela organização que o desenvolveu, sua medida de comparação é dada em número de Loops por Segundo. Qual é esse Benchmark?\n\n\n\n\nQual Benchmark possui alto percentual de dados e operações de ponto flutuante;Alto percentual de tempo de CPU (execução) é gasto em funções matemáticas;Usa variáveis globais na programação, não usa variáveis locais nas funções de sua programação ?\n\n\n\n\nQual Benchmark foi criado por uma organização fundada em Outubro de 1988 por especialistas das empresas Apollo, Hewlett-Packard, MIPS e Sun Microsystems, e possui como meta, realismo de medidas de sistemas computacionais avançados para a indústria e educação dos consumidores quanto aos aspectos de desempenho ?\n\n\n\n\nQual Benchmark foi desenvolvido pela Silicon Graphics – mantido pelo Mindcraft test lab, com o objetivo de medir desempenho de software e hardware de servidores Web, testando  no Servidor os Serviços Web; Sistema Operacional; CPU; e Velocidade de Acesso à Rede, porém não testa a influência de velocidade de acesso a disco ?\n\n\n\n\nEntre as principais medidas apresentadas no Webstone, encontramos o Throughput máximo de rede; e o Tempo médio de resposta. O que é o Throughput de dados?\n\n\n\n\nQual Benchmark simula uma coleção de usuários acessando um Servidor Web, sua arquitetura é composta por um conjunto de clientes virtuais, criados por software, conectados a um servidor Web, permite ao usuário especificar um conjunto de threads a serem analisadas, avalia requisições a documentos no servidor ?\n\n\n\n\nAo método que produz a versão simplificada de um sistema computacional que contém apenas características relevantes para análise do funcionamento do sistema damos o nome de:\n\n\n\n\nA aplicação da prototipação permite uma experiência de qualidade no desenvolvimento de uma solução tecnológia, entre as considerações principais sobre o uso de protótipos descritas a seguir, qual não se aplica?\n\n', 'PUBLISHED', '2021-04-08 02:22:59', '2021-04-08 02:23:27', '2021-05-16 17:15:29', NULL, 9223372036854775807, NULL, '2021-05-16 17:15:29', '2021-05-16 17:16:01', 252463933928),
